function App() {
  return (
    <Router> {/* Router로 앱을 감쌈 */}
      <div className="App">
        <Header />
      </div>
      <div className='main-content'>
        <Sidebar />
        <div className='content-area'>
          <h2>hello world</h2>
          </div>
          </div>
    </Router>
  );
}

export default App;
